import React from "react";
import Card from './Card';
import DataArray from "./DataArray";
const Container =()=> <>
    <div className="container">
        <Card 
            imgsrc = {DataArray[0].imgSrc}
            movieName = {DataArray[0].movieName}
            link = {DataArray[0].link}
        />
        
        <Card 
            imgsrc = {DataArray[1].imgSrc}
            movieName = {DataArray[1].movieName}
            link = {DataArray[1].link}
        />
        
        <Card 
            imgsrc = {DataArray[2].imgSrc}
            movieName = {DataArray[2].movieName}
            link = {DataArray[2].link}
        />
        
        <Card 
            imgsrc = {DataArray[3].imgSrc}
            movieName = {DataArray[3].movieName}
            link = {DataArray[3].link}
        />

        <Card 
            imgsrc = {DataArray[4].imgSrc}
            movieName = {DataArray[4].movieName}
            link = {DataArray[4].link}
        />
        
    </div>
</>;

export default Container;
